// Home.js

import React from "react";
import { Outlet, Link } from "react-router-dom";
import { IoHome } from "react-icons/io5";
import './Home.css';
import logo from './1.png'; // Import your temporary logo image

const Home = () => {
    return (
        <>
            <header>
                <nav>
                    <Link to="/Home" title="Home">
                        <img src={logo} alt="Logo" className="home-icon" onClick={() => { window.location.href = '/Home' }} />
                        Home
                    </Link>
                    <Link to="/Student" title="Student">Student</Link>
                    <div className="dropdown">
                        <Link to="/LandlordLogin" className="dropbtn">Landlord</Link>
                        <div className="dropdown-content">
                            <Link to="/LandlordLogin">Login</Link>
                            <Link to="/LandlordSignup">Signup</Link>
                        </div>
                    </div>
                    <Link to="/WardenLogin" title="Warden">Warden</Link>
                    <Link to="/AdminLogin" title="Admin">Admin</Link>
                </nav>
            </header>
            <Outlet />
        </>
    );
}

export default Home;
